webpackJsonp([0xadbfe314096f],{5666:function(e,t){e.exports={data:{post:{html:"<p>It took two months for Schr√∂der to pull even with Stoiber in the polls. After the ousters of Telekom boss Sommer and Defence Minister Sharping, it took just a week to give it all back. <a href=\"http://www.zdf.de/ZDFde/inhalt/0,1872,2007711,FF.html\">ZDF's Politbarometer</a> reported a 5% drop for the SPD in their biweekly poll, giving Union/FDP a majority if the election were held now. The SPD is responding by starting the 'hot phase' of the campaign next Monday, 3 weeks earlier than planned. Meanwhile, someone is releasing politicians' frequent flyer data to the Bild Zeitung. Funny, only politicians left of center are being outed. You don't suppose that it's a plot to help the Union? Nah......</p>",fields:{title:"Back To Life, Back To Reality",date:"31 Jul 2002",url:"https://papascott.de/2002-07-31-back-to-life-back-to-reality/"}}},pathContext:{slug:"/2002-07-31-back-to-life-back-to-reality/",prev:{fields:{title:"Welcome to PapaScott's pMachine!",date:"30 Jul 2002",slug:"/2002-07-30-welcome-to-papascotts-pmachine/"}},next:{fields:{title:"Lock Up The Dying",date:"31 Jul 2002",slug:"/2002-07-31-lock-up-the-dying/"}}}}}});
